import { useState, useEffect } from 'react';
import logo from './logo.svg';
import './App.css';



function App() {
  const [name, setName] = useState('name');
  const [languages, setLanguages] = useState('')

  useEffect(() => {
    fetch("https://api.github.com/repos/r-swords/LCAJava")
      .then(res =>res.json())
      .then(data =>{setData(data)});
    fetch("https://api.github.com/repos/r-swords/LCAJava/languages")
      .then(res => res.json())
      .then(data => setLanguages(data));
  }, [])

  const setData = ({name}) => {
    setName(name);
  }

  const fetchTasks = async () => {
    const res = await fetch('https://api.github.com/reops/r-swords/LCAJava')
    const data = await res.json()

    return data
  }


  return (
    <div className="App">
      <h1>{name}</h1>
      Object.keys({languages}.object).map((key, i) => (
          <p key={i}>
            <span>Key Name: {key}</span>
            <span>Value: {{languages}.object[key]}</span>
          </p>
        )
    </div>
  );
}

export default App;
